function loginapi(){var e=document.getElementById("email_field").value,n=document.getElementById("password_field").value;firebase.auth().signInWithEmailAndPassword(e,n).then(function(e){alert("Login Success"),console.log(e)}).catch(function(e){var n=e.code,t=e.message;window.alert("Error : "+t),console.log(n)})}function logout(){firebase.auth().signOut()}firebase.auth().onAuthStateChanged(function(e){e?alert("You Have Logged In!!!"):alert("PLEASE LOGIN!")});